# COMPARISON SORTS
def bubbleSort(arr):
	swapping = True
	swapsDone = list()
	while swapping:
		swaps = 0
		for i in range(len(arr) - 1):
			if (arr[i] > arr[i + 1]):
				arr1 = arr[i];
				arr[i] = arr[i + 1]
				arr[i+1] = arr1
				swaps += 1
		swapsDone.append(swaps)
		if swaps == 0:
			swapping = False
	print('bubble swaps: ', swapsDone)
	return arr

