#Selection sort O(n^2)
def selectionSort(arr):
	sortedArr = list()
	while len(arr) > 0:
		currentSmallest = arr[0]
		for i in range(len(arr)):
			if currentSmallest > arr[i]:
				currentSmallest = arr[i]
		sortedArr.append(arr.pop(arr.index(currentSmallest)))
	return sortedArr
