def insertionSort(arr):
	insertions = 0
	for i in range(1,len(arr)):
		value = arr[i]
		pos = i
		while pos > 0 and value < arr[pos - 1]:
			arr[pos] = arr[pos - 1]
			pos -= 1
			insertions += 1
		arr[pos] = value
	print('insertions: ', insertions)
	return arr
