################# OPTIMIZED MERGE SORT ################################
def OMSMerger(arr, left,right, end, tempArr):
	l = left
	r = right
	t = 0
	while l < right and r < end:
		if arr[l] < arr[r]:
			tempArr[t] = arr[l]
			l += 1
		else:
			tempArr[t] = arr[r]
			r += 1
		t += 1
	while l < right:
		tempArr[t] = arr[l]
		l += 1
		t += 1
	while r < end:
		tempArr[t] = arr[r]
		t += 1
		r += 1
	for i in range(end - left):
		arr[i + left] = tempArr[i]

def recursiveMergeSort(arr, first,last, tempArr):
	mergesorts = 0
	if first == last:
		return 0
	else:
		mid = (first + last) // 2
		mergesorts += recursiveMergeSort(arr, first, mid, tempArr)
		mergesorts += recursiveMergeSort(arr, mid + 1,last, tempArr)

		OMSMerger(arr, first, mid + 1, last + 1, tempArr)
		mergesorts += 1
		return mergesorts
	
def optimizedMergeSort(arr):
	n = len(arr)
	tempArr = n * [0]
	merges = recursiveMergeSort(arr, 0, n - 1, tempArr)
	print("merges: ", merges // 2)
	return arr

