# Quick Sort O(nlogn) -- better space than Merge Sort but has worst case running time of O(n^2) if list is already sorted -- cannot ahndle duplicate data
def partitionSeq( arr, first, last ):
	# Save a copy of the pivot value.
	pivot = arr[first]
	# Find the pivot position and move the elements around the pivot.
	left = first + 1
	right = last
	while left <= right :
	# Find the first key larger than the pivot.
		while left < right and arr[left] <= pivot :
			left += 1
		# Find the last key in the sequence that is smaller than the pivot.
		while right >= left and pivot <= arr[right] :
			right -= 1
		# Swap the two keys if we have not completed this partition.
		if left < right :
			tmp = arr[left]
			arr[left] = arr[right]
			arr[right] = tmp
	# Put the pivot in the proper position.
	if right != first :
		arr[first] = arr[right]
		arr[right] = pivot
	# Return the index position of the pivot value.
	return right

def recQuickSort( arr, first, last ):
	# Check the base case.
	if first >= last :
		return
	else :
		# Save the pivot value.
		pivot = arr[first]
	
		# Partition the sequence and obtain the pivot position.
		pos = partitionSeq( arr, first, last )
		# Repeat the process on the two subsequences.
		recQuickSort( arr, first, pos - 1 )
		recQuickSort( arr, pos + 1, last )

def quickSort( arr ):
	n = len( arr )
	recQuickSort( arr, 0, n-1 )






