def minimumSwaps(arr):
    first = 0
    last = len(arr) - 1;
    swaps = 0;
    while first < last:
        while arr[first] == first + 1 and first < last:
            first += 1
        if first < last:
            temp = arr[arr[first] - 1];
            arr[arr[first] - 1] = arr[first];
            arr[first] = temp;
            swaps += 1
    return swaps;


# you'll know if the range of the inputs is small 0 to 200
def countSort(arr):
	m = max(arr) + 1
	n = len(arr)
	countArr = m * [0]
	for i in range(n):
		countArr[arr[i]] += 1
		
	s = 0
	for j in range(len(countArr)):
			tmp = countArr[j]
			while tmp > 0:
					arr[s] = j
					tmp -= 1
					s += 1
	return arr

