# RADIX (bin) SORT using queues--  individual digits of the elements are compared from LSB to MSB to sot the list
#import queue -- python queue
class QueueNode( object ):
	def __init__( self, item ):
		self.item = item
		self.next = None

class LinkedListQueue :
	def __init__(self):
		self.size = 0
		self.head = None
		self.tail = None
	
	def __len__( self ):
		return self.size
	
	def isEmpty( self ):
		return self.head is None

	def enqueue( self, item ):
		node = QueueNode( item )
		if self.isEmpty() :
			self.head = node
		else :
			self.tail.next = node
		self.tail = node
		self.size += 1
	
	def dequeue( self ):
		assert not self.isEmpty(), "Cannot dequeue from an empty queue."
		node = self.head
		if self.head is self.tail :
			self.head = None
			self.tail = None
		else:
			self.head = self.head.next
		self.size -= 1
		return node.item
#O(k +dn)
def radixSort( intList, numDigits ):
	# Create an array of queues to represent the bins.
	binArray = 10 * [0]
	for k in range( 10 ):
		binArray[k] = LinkedListQueue()
		# The value of the current column.
	column = 1
		# Iterate over the number of digits in the largest value.
	for d in range( numDigits ):
		# Distribute the keys across the 10 bins.
		for key in intList :
			#this is where special property of elements is determined
			digit = (key // column) % 10
			binArray[digit].enqueue( key )
		# Gather the keys from the bins and place them back in intList.
		i = 0
		for bin in binArray :
			while not bin.isEmpty() :
				intList[i] = bin.dequeue()
				i += 1
			# Advance to the next column value.
		column *= 10

